PREFIX std223: <http://data.ashrae.org/standard223#>

SELECT DISTINCT ?zone ?zoneLabel ?propLabel ?alcEndpoint ?mpcEndpoint
WHERE {
  # Each zone instance
  ?zone a std223:Zone .
  OPTIONAL { ?zone rdfs:label ?zoneLabel }

  # Properties associated with the zone
  ?zone std223:hasProperty ?prop .
  ?prop rdfs:label ?propLabel .

  # Exclude writable properties (both explicit true and any truthy literal)
  FILTER NOT EXISTS { ?prop brick:writable true }
  FILTER NOT EXISTS { ?prop brick:writable "true"^^<http://www.w3.org/2001/XMLSchema#boolean> }

  # ALC endpoint reference (generic Brick endpoint)
  OPTIONAL { ?prop brick:endpoint ?alcEndpoint }

  # MPC endpoint reference (Brick property for MPC DB name)
  OPTIONAL { ?prop brick:mpc_db_name ?mpcEndpoint }
}
ORDER BY ?zone ?propLabel

